import React, { Fragment, useRef } from "react";
import {
  motion,
  useScroll,
  useSpring,
  useTransform,
  MotionValue
} from "framer-motion"

/* Styles */
import './home.scss'

export function Home() {

  return (
    <Fragment>
      <div className="header-sep"></div>
      <motion.div className="index">
        <div className="header-sep"></div>
        <section className="component1">
          <motion.div
            whileHover={{ scale: 1.2 }}
            whileTap={{ scale: 0.5 }}
          />
        </section>
        <section className="component2">
          <>
            {[1, 2, 3, 4, 5].map((image) => (
              <Banner id={image} />
            ))}
          </>
        </section>
        <section className="component3">asd</section>
        <section className="component4">asd</section>
      </motion.div>
    </Fragment>
  );
}
